import React, { useState, useEffect } from 'react';

function App() {
  const [workouts, setWorkouts] = useState([]);
  const [newWorkoutTitle, setNewWorkoutTitle] = useState('');

  useEffect(() => {
    // Fetch the list of workouts when the component mounts
    fetchWorkouts()
      .then((data) => {
        setWorkouts(data);
      })
      .catch((error) => {
        console.error('Error fetching workouts:', error);
      });
  }, []);

  const handleCreateWorkout = () => {
    // Create a new workout when the button is clicked
    createWorkout(newWorkoutTitle)
      .then((newWorkout) => {
        // Add the new workout to the list of workouts
        setWorkouts([...workouts, newWorkout]);
        setNewWorkoutTitle(''); // Clear the input field
      })
      .catch((error) => {
        console.error('Error creating workout:', error);
      });
  };

  return (
    <div>
      <h1>Workouts</h1>

      {data.length === 0 ? (
        <p>Loading...</p>
      ) : (
        data.map((workout, i) => (
          <div key={i}>
            <p>{workout.title}</p>
          {/* You can display other workout properties here */}
          </div>
        ))
      )}
    </div>
  );
}

export default App;
